import React, { useEffect, useState } from "react";
import "./App.css";
import AllList from "./My Compnents/AllList";
import {BrowserRouter as Router} from 'react-router-dom';

function App() {
  const [user, setUser] = useState([]);

  useEffect(() => {
    fetch("/api")
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        setUser(data.employees);
      });
  }, []);

  return (
    <>
      <AllList user={user}/>
    </>
  );
}

export default App;
